CREATE TABLE `Questionnaire` (
  `ID` int NOT NULL AUTO_INCREMENT,
  `Product` int NOT NULL,
  `User` int NOT NULL,
  `Datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `Age` int DEFAULT NULL,
  `Sex` char(1) DEFAULT NULL,
  `ExpertiseLevel` varchar(8) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `ID` (`ID`,`Product`),
  UNIQUE KEY `Product` (`Product`,`User`),
  KEY `User` (`User`),
  CONSTRAINT `questionnaire_ibfk_1` FOREIGN KEY (`Product`) REFERENCES `Product` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `questionnaire_ibfk_2` FOREIGN KEY (`User`) REFERENCES `User` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `questionnaire_chk_1` CHECK ((`Sex` in (_utf8mb4'M',_utf8mb4'F'))),
  CONSTRAINT `questionnaire_chk_2` CHECK ((`ExpertiseLevel` in (_utf8mb4'LOW',_utf8mb4'MEDIUM',_utf8mb4'HIGH')))
